import React from 'react'

function ComponentPopup(props) {
  return (props.trigger) ? (
    <div className='componentpopup'>
        <div className='popup-inner'>
            <button className='close-btn'>close</button>
            {props.children}
        </div>
    </div>
  ) : "";
}

export default ComponentPopup
